import React, { useState } from 'react';
import Client from '../components/Client';

const EditorPage = () => {
  const [clients,setClients] = useState([{socketId: 1, username: 'Rakesh k'},
  {socketId: 2, username: 'John Doe'},]);
  return (
    <div className="mainWrapper">
        <div className='aside'>
          <div className="asideInner">
            <div className="logo">
              <img className="logoImage" src='/app_logo.png' alt="app-logo"/>
            </div>
            <h3>Connected</h3>
            <div className="clientsList">
                        {clients.map((client) => (
                            <Client
                                key={client.socketId}
                                username={client.username}
                            />
                        ))}
            </div>
          </div>
          <button className='btn'>Copy ROOM ID</button>
          <button className='btn'>Leave</button>
        </div>
        <div className="editorWrap">
            Editor goes Here...
        </div>
    </div>
  )
}

export default EditorPage
